import React from 'react';
import './App.css';
import Menu from './Components/Menu';

state = {
  page: 'LandingPage'
}

playlistNames = [
  {
    name: 'Example',
    songs: [
      {
        name: '3 nights by',
        artist: 'Dominic Fike'
      }, 
    ]
  }
]
songNames = [
  {
    name: '3 nights by',
    artist: 'Dominic Fike'
  }, 
  {
    name: 'Bang!',
    artist: 'AJR',
  },
  {
    name: 'Tribe',
    artist: 'Jim Swim'
  },
  {
    name: 'Feels Right',
    artist: 'Danny\'s dead'
  },
  {
    name: 'Mariposa',
    artist: 'Peach Tree Rascals'
  },
  {
    name: 'Blinding Lights',
    artist: 'The Weeknd'
  },
  {
    name: 'Thriller',
    artist: 'Michael Jackson'
  },
  {
    name: 'Yellow Submarine',
    artist: 'The Beatles'
  },
  {
    name: 'USSR',
    artist: 'The Beatles'
  },
]
librarySongNames = [
  {
    name: 'Mariposa',
    artist: 'Peach Tree Rascals'
  },
  {
    name: 'Blinding Lights',
    artist: 'The Weeknd'
  },
  {
    name: 'Thriller',
    artist: 'Michael Jackson'
  },
  {
    name: 'Yellow Submarine',
    artist: 'The Beatles'
  },
  {
    name: 'USSR',
    artist: 'The Beatles'
  },
]

changeState = (newPage) => {
  state.page = newPage;
}

function App() {
  return (
    <div className="App">
      {state.page === 'LandingPage' &&
        <span>
          <Menu />
        </span>
      }
      {state.page === 'Playlists' &&
        <span>
          <ListView data = {playlistNames}/>
        </span>
      }
      {state.page === 'NowPlaying' &&
        <span>
          <Menu />
        </span>
      }
      {state.page === 'Search' &&
        <span>
          <ListView data = {songNames}/>
        </span>
      }
      {state.page === 'Library' &&
        <span>
          <ListView data = {librarySongNames}/>
        </span>
      }
    </div>
  );
}

export default App;
